export default function User() {
  return (
    <div class="usuario">
      <img src="assets/img/catanacomics.svg" alt="imagem de perfil" />
      <div class="texto">
        <span>
          <strong>catanacomics</strong>
          <ion-icon name="pencil"></ion-icon>
        </span>
      </div>
    </div>
  );
}
